import { SET_CURRENT_CLIENT, SET_ALL_CLIENTS } from "./types";

export const storeClient = (client) => ({
  type: SET_CURRENT_CLIENT,
  client,
});

export const storeAllClients = (clients) => ({
    type: SET_ALL_CLIENTS,
    clients,
  });
